import React from "react";

function Icon() {
  return (
    <svg className='box-icon'
      xmlns="http://www.w3.org/2000/svg"
      width="140"
      height="140"
      fill="none"
      viewBox="0 0 140 140"
    >

      <path
        fill="#ACABAB"
        d="M34 34h81v81H34V34zM24 24l10 10v81L24 85V24z"
      ></path>
      <path fill="blue" d="M34 34h81L85 24H24l10 10z"></path>
      <path fill="green" d="M34 34h81L85 24H24l10 10z"></path>
      <path fill="black" d="M34 34h81L85 24H24l10 10z"></path>
      <path fill="white" d="M34 34h81L85 24H24l10 10z"></path>
      <path fill="yellow" d="M24 24l10 10v81L24 85V24z"></path>
    </svg>
  );
}

export default Icon;
